import React, {useState} from 'react'
import Display from '../component/Display';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import moment from 'moment';

function Dashboard() {
    const [result, setResult] = useState(null)
    const [selectedDate, setSelectedDate] = useState(null)

    const handleClick = async () => {
        console.log('Clicked Bookings');
        console.log(selectedDate);
        const date = selectedDate.getFullYear() + '-' + selectedDate.getMonth() + '-' + selectedDate.getDate()
        console.log(date)
        const response = await fetch(`https://playo.club/book-api/v5/availability/e63abe94-2547-409a-9b30-82cbcec2c468/SP4/${date}/?userId=7406560606&deviceType=99`,
            {
                method: 'GET',
                headers: {
                    'Accept': 'application/json',
                    'Authorization': 'b4ee93df154de37b0e38aa6a5dfda071aa751bfa'    
                }
            });
        const res = await response.json();
        console.log(res);
        setResult(res);
    }

  return (
    <div>
        <div>Playo Dashboard</div>
        <DatePicker
            selected = {selectedDate}
            onChange = {date => setSelectedDate(date)}
            dateFormat = 'yyyy-MM-dd'
        />
        <Display res={result}/>
        <button onClick={handleClick}>Check Bookings</button>
    </div>
  )
}

export default Dashboard;
